import React from 'react'
import { useState } from 'react';

const AddForm = () => {


    const handleSubmit = event => {
        // event.preventDefault();
        // handle form submission here
        console.log(
            {
                id: 1000,
                img: inputImg,
                productname: inputProductName,
                username: inputUsername,
                score: 4.9,
                price: inputPrice,
            }
        )
    };

    const [inputImg, setImg] = useState("");
    const [inputProductName, setProductName] = useState("");
    const [inputUsername, setUsername] = useState("LuluMania");
    const [inputPrice, setInputPrice] = useState();


    return (
        <div>
            <div className='profile--main--right--bottom'>
                <div>
                    <p>
                        Product Img Preview
                    </p>
                </div>
                <div >
                    <h1>Add Your New Item Now</h1>

                    {/* Form */}
                    <form className="add-item-form">
                        <label>
                            <p>Product Image:</p>
                            <input

                                type="text"
                                value={inputImg}
                                onChange={e => setImg(e.target.value)}
                                className='add-item-input'
                            />
                        </label>

                        <label>
                            <p>Item Name:</p>
                            <input
                                type="text"
                                value={inputProductName}
                                onChange={e => setProductName(e.target.value)}
                                className='add-item-input'
                            />
                        </label>
                        <label>
                            <p>Price:</p>
                            <input
                                type="number"
                                value={inputPrice}
                                onChange={e => setInputPrice(e.target.value)}
                                className='add-item-input'
                            />
                        </label>
                        <label>
                            <p>Username:</p>
                            <input
                                type="text"
                                value={inputUsername}
                                onChange={e => setUsername(e.target.value)}
                                className='add-item-input'
                            />
                        </label>

                    </form>
                    <button className="add-item-submit"
                        onClick={handleSubmit}>List Your Item</button>
                </div>
            </div>
        </div>
    )
}

export default AddForm
